const TOKEN  = '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';
const REPO   = 'winduadiprabowo-pixel/core-meridian-data';
const BRANCH = 'main';
const BASE_URL = 'https://api.github.com';

const HEADERS = {
  'Authorization': 'token ' + TOKEN,
  'Content-Type': 'application/json',
  'Accept': 'application/vnd.github.v3+json',
  'User-Agent': 'ZeroMeridian-Push',
};

async function getSHA(path) {
  try {
    const url = BASE_URL + '/repos/' + REPO + '/contents/' + path + '?ref=' + BRANCH;
    const res = await fetch(url, { headers: HEADERS });
    if (res.status === 404) return null;
    if (!res.ok) return null;
    const data = await res.json();
    return data.sha || null;
  } catch { return null; }
}

async function pushFile(path, content, message) {
  const sha = await getSHA(path);
  const body = {
    message,
    content,
    branch: BRANCH,
    ...(sha ? { sha } : {}),
  };
  const url = BASE_URL + '/repos/' + REPO + '/contents/' + path;
  const res = await fetch(url, {
    method: 'PUT',
    headers: HEADERS,
    body: JSON.stringify(body),
  });
  if (!res.ok) {
    const err = await res.text();
    throw new Error('Push failed: ' + path + ' → ' + err.slice(0, 200));
  }
  return await res.json();
}

async function sleep(ms) {
  return new Promise(r => setTimeout(r, ms));
}

