// ─── MAIN ────────────────────────────────────────────────────────────────────
async function main() {
  console.log('\n🚀 ZERØ MERIDIAN push75 — pushing ' + FILES.length + ' files to GitHub...');
  console.log('Repo: ' + REPO + ' / Branch: ' + BRANCH + '\n');

  let success = 0;
  let failed  = 0;
  const errors = [];

  for (let i = 0; i < FILES.length; i++) {
    const file = FILES[i];
    const num  = (i + 1).toString().padStart(3, ' ');
    const total = FILES.length;
    
    try {
      await pushFile(file.path, file.content, 'push75: ' + file.path);
      success++;
      console.log('[' + num + '/' + total + '] ✅ ' + file.path);
    } catch (e) {
      failed++;
      errors.push(file.path + ': ' + e.message);
      console.error('[' + num + '/' + total + '] ❌ ' + file.path + ' → ' + e.message.slice(0, 80));
    }

    // Rate limit: 1 request per 100ms to avoid GitHub API rate limit
    if (i < FILES.length - 1) await sleep(120);
  }

  console.log('\n' + '='.repeat(60));
  console.log('✅ SUCCESS: ' + success + ' files');
  if (failed > 0) {
    console.log('❌ FAILED:  ' + failed + ' files');
    errors.forEach(e => console.log('   → ' + e));
  }
  console.log('\n🌐 Vercel auto-deploy dimulai...');
  console.log('🔗 Live: https://meridian-zero-jet.vercel.app');
  console.log('='.repeat(60) + '\n');
}

main().catch(console.error);
